import React from "react";

const FormLogin = () => {
  return (
    <div className="form">
      <section className="form__container">
        <h2>Incio de Sesión</h2>
        <input
          className="form__container--input"
          type="text"
          placeholder="Usuario"
        ></input>
        <input
          className="form__container--input"
          type="password"
          placeholder="Contraseña"
        ></input>
        <button className="btn form__container--button">Iniciar sesión</button>
      </section>
    </div>
  );
};

export default FormLogin;
